CortanaConsentPanel.Description:
Чтобы ответить на ваши вопросы, запомнить важные данные и сделать многое другое, Кортане нужна некоторая информация. Позвольте Кортане собирать и использовать следующее:

• местонахождение и журнал местонахождений;

• контакты, данные календаря и журнал содержимого и контактов из сообщений, мгновенных сообщений и приложений;

• журнал поиска и другие данные на вашем устройстве. Это сделает взаимодействие с Кортаной более персонализированным.
